import { Heading, Button } from '@chakra-ui/core';
import Layout from '../components/layout/Layout';

const Home = (props) => {
  const { colorMode, toggleColorMode } = useColorMode();
  return (
    <Layout>
      <Heading>HOME</Heading>;
      <Button onClick={toggleColorMode}>Change Mode</Button>
    </Layout>
  );
};

export default Home;
